import React from 'react';
import HeaderWithSidebar from '../Sidebar';

function Events() {
  return(
    <div>
        <HeaderWithSidebar />
        <div className="container">
            <h1>Events to be held in PES University: </h1>
        </div>
    </div>
  );
}

export default Events;
